import React from 'react'
import { Container, Row, Col, ListGroup, ListGroupItem } from "reactstrap";
import './Footer.css'

import {Link} from 'react-router-dom';
import logo from "../../assets/images/Trackway.png";

const quick_link = [
  {
    path: "/home",
    display: "Home",
  },

  {
    path: "/about",
    display: "About",
  },

  {
    path: "/tours",
    display: "Tours",
  }
];


const quick_link2 = [
  {
    path: "/Gallery",
    display: "Gallery",
  },

  {
    path: "/login",
    display: "Login",
  },

  {
    path: "/register",
    display: "Register",
  }
];

const Footer = () => {
  return (
   <section>
    <Container>
      <Row>
        <Col lg='3'>
          <div className="logo">
            <img src={logo} alt="" />
            <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Facere, voluptatibus.</p>

            <div className="social d-flex align-items-center gap-4">
            <span>
              <Link to ='#'>
              <i class="ri-youtube-fill"></i>
              </Link>
            </span>

            <span>
              <Link to ='#'>
              <i class="ri-facebook-fill"></i>
              </Link>
            </span>

            <span>
              <Link to ='#'>
              <i class="ri-github-fill"></i>
              </Link>
            </span>
            </div>
          </div>

        </Col>
        <Col lg='3'>
          <h5 className="footer__link-title">Discovery</h5>
          <ListGroup className='footer__quick-links'>
            {quick_link.map((item,index)=>(
              <ListGroupItem key={index} className='ps-0 border-0'>
                <Link to ={item.path}>{item.display}</Link>
               </ListGroupItem>
            ))}
          </ListGroup>
        </Col>
        
        <Col lg='3'>
          <h5 className="footer__link-title">Quick-Links</h5>
          <ListGroup className='footer__quick-links'>
            {quick_link2.map((item,index)=>(
              <ListGroupItem key={index} className='ps-0 border-0'>
                <Link to ={item.path}>{item.display}</Link>
               </ListGroupItem>
            ))}
          </ListGroup>
        </Col>

       
      </Row>
    </Container>
   </section>
  )
}

export default Footer
